import React, { Component } from 'react';
import { Collapse, Container, Navbar, NavbarBrand, NavbarToggler, NavItem, NavLink } from 'reactstrap';
import { Link } from 'react-router-dom';
import './NavMenu.css';

export class NavMenu extends Component {
  static displayName = NavMenu.name;

  constructor (props) {
    super(props);

    this.toggleNavbar = this.toggleNavbar.bind(this);
    this.state = {
      collapsed: true
    };
  }

  toggleNavbar () {
    this.setState({
      collapsed: !this.state.collapsed
    });
  }

  render () {
    return (
      <div class="w3-bar w3-white w3-large">
        <a href="#" class="w3-bar-item w3-button w3-indigo w3-mobile"><i class="fa fa-bicycle w3-margin-right"></i>SWEBIKE</a>
        <a href="#cyklar" class="w3-bar-item w3-button w3-mobile">Cyklar</a>
        <a href="#contact" class="w3-bar-item w3-button w3-mobile">Kontakta</a>
        <a href="#about" class="w3-bar-item w3-button w3-mobile">Om oss</a>
        <a href="#contact" class="w3-bar-item w3-button w3-right w3-light-grey w3-mobile">Logga in</a>
      </div>
    );
  }
}
